        jQuery(document).ready(function(){

            for (var index = 0; index < 9; index++)
                $('#img_' + index).prop('checked', false);

            let url = '/valudate';

            $('.image-container .btn-success').click(function(evt){
                var send_array = [];
                for (var index = 0; index < 9; index++)
                    send_array.push(  $('#img_' + index).is(':checked')  );

                $( '<div id="preloader"></div>' ).insertBefore( ".back-to-top" );

                var post_data = {'send_array': send_array};
                $.post({
                    url: '/validate',
                    data: JSON.stringify(post_data),
                    contentType: 'application/json; charset=utf-8'
                    })
                    .done(function( data ) {
                        if( data.validated )
                            window.location.href = data.ret_path;
                        else
                            window.location.reload();
                    })
                    .fail(function() {
                        window.location.reload();
                    });
            });

        });
